<script setup>
import { DArrowRight, Edit } from '@element-plus/icons-vue'
import { useRouter } from 'vue-router';
import { useUserStore } from '@/store/user'
import { getExamByStudentId, getSCByStudentId,getExamByTeacherId } from '@/api/index'
import { onMounted, ref } from 'vue'
import { ElMessage } from 'element-plus';

const store = useUserStore()
const router = useRouter()
const list = ref([])

const scList = ref([])
const getScInfo = async () => {
  const { data } = await getSCByStudentId({ studentId: store.info.userId })
  scList.value = data
}

onMounted(() => {
  getList()
})

const getList = async () => {
  try {
    await getScInfo()
    console.log(store.isTeacher)
    if(store.isStudent){
      const { data, code } = await getExamByStudentId({ studentId: store.info.userId })
      list.value = data
      list.value.forEach(item => {
      item.examInfo = scList.value.find(i => i.scCourseId == item.courseId)
    })
    }
    if(store.isTeacher){
    const { data, code } = await getExamByTeacherId({ teacherId: store.info.userId })
    list.value = data
    }
    // console.log(data)
    
    
    console.log('list.value', list.value)
  } catch (e) {
    ElMessage.error('获取考试列表失败!')
  }
}

const goTakeExam = (item) => {
  console.log(item)
  router.push({ name: 'TakeExam' })
  sessionStorage.setItem('exam', JSON.stringify(item))
}
</script>

